class BMICalculator extends Component {
  render() {
    return (
      <div id="divContainer">
        <div id="divHead">BMI Calculator</div>
        <div id="divInputs">
            <div><label>Enter Height</label><input id="inpHeight"/></div>
            <div><label>Enter Height</label><input id="inpHeight"/></div>
            <button id="btnCalculate">Calculate</button>
        </div>
        <div id='divResult'>
            <p>18.6</p>
            <p>Underweight</p>
        </div>
      </div>
    )
  }
}

export default BMICalculator
